import {Button, Stack} from "react-bootstrap";
import {useRef} from "react";

let Nav = ({onMoveToFocus, el}) => {

    let onScroll = useRef(el);

    return (
        <nav>
            <Stack direction="horizontal" className="d-sm-flex justify-content-center align-items-center">
                <Button onClick={() => onMoveToFocus(onScroll)} size={"sm"}> 호텔상품 보기 </Button>
                <Button onClick={() => onMoveToFocus(onScroll)} size={"sm"} className={'m-lg-3'}> 인기상품 보기 </Button>
            </Stack>
        </nav>
    )
}

export default Nav;
